import React from 'react';
import Nav from './Nav/Nav';
import './Auth.css';

const Auth = () => {
  return (
    <div className='LoginContainer'>
      <Nav />
        <h1>Login</h1>
      <div className='DetailContainer'>
        <label>Username</label>
        <input type='text' />
        <label>Password</label>
        <input type='text' />
      </div>
    </div>
  );
}

export default Auth;
